import Typewriter from 'typewriter-effect';
import {useEffect} from 'react';

export default function Landing(props) {
    return (
        <div className="auth-parent">
            <div className="panel">
                <div className="paneltext">
                    <Typewriter
                        options={{
                            autoStart: true,
                            delay: 25,
                            cursor: ""

                        }}
                        onInit={(typewriter) => {
                            typewriter.typeString('William Toth OS').start();
                        }}
                    />
                    <Typewriter
                        options={{
                            autoStart: true,
                            delay: 25,
                            cursor: ""

                        }}
                        onInit={(typewriter) => {
                            typewriter.pauseFor(1000).typeString("Copyright (c) 2022, All Rights Reserved")
                                .start();
                        }}
                    />
                    <Typewriter
                        options={{
                            autoStart: true,
                            delay: 25,
                            cursor: ""

                        }}
                        onInit={(typewriter) => {
                            typewriter.pauseFor(2500).typeString("Version 1.0")
                                .start();
                        }}
                    />
                    <br />
                    <Typewriter
                        options={{
                            autoStart: true,
                            delay: 25,
                            cursor: ""

                        }}
                        onInit={(typewriter) => {
                            typewriter.pauseFor(3500).typeString("Battery pack: 97% ok")
                                .start();
                        }}
                    />
                    <Typewriter
                        options={{
                            autoStart: true,
                            delay: 25,
                            cursor: ""

                        }}
                        onInit={(typewriter) => {
                            typewriter.pauseFor(4500).typeString("Memory Test: 8192 ok")
                                .start();
                        }}
                    />
                    <Typewriter
                        options={{
                            autoStart: true,
                            delay: 25,
                            cursor: ""

                        }}
                        onInit={(typewriter) => {
                            typewriter.pauseFor(5500).typeString("Initializing").pauseFor(200)
                            .typeString(".").pauseFor(400)
                            .typeString(".").pauseFor(400)
                            .typeString(".").pauseFor(400)
                            .changeDelay(2)
                            .typeString(" DONE")
                                .start();
                        }}
                    />
                    <br />
                    <Typewriter
                        options={{
                            autoStart: true,
                            delay: 25,
                            cursor: ""

                        }}
                        onInit={(typewriter) => {
                            typewriter.pauseFor(8000).typeString("You are about to enter Will Toth's personal portfolio").start();
                        }}
                    />
                    <Typewriter
                        options={{
                            autoStart: true,
                            delay: 25,
                            cursor: ""

                        }}
                        onInit={(typewriter) => {
                            typewriter.pauseFor(10000).typeString("Press any key to start system").start();
                        }}
                    />
                </div>
            </div>
        </div>
    )
}
